import React from 'react';

const contactStyle = {
  textAlign: 'center',
  fontSize: '24px',
  fontWeight: 'bold',
  padding: '20px',
  backgroundColor: '#f9f9f9',
  border: '1px solid #ccc',
  borderRadius: '5px',
  width: '60%',
  margin: '20px auto',
};

export default function Contact() {
  return (
    <div style={contactStyle}>
      Contact on Email: sumitkumar28779@gmail.com
    </div>
  );
}
